mapper.select:
SELECT DOC_ID, DOC_NM, DIS_CLASS_DTL, DOC_CLASS_DTL, DOC_HEADER FROM BDSP.T_DOC_MST WHERE 1=1 AND DIS_CLASS_DTL = #{disClassDtl}
AND DOC_CLASS_DTL = #{docClassDtl}
ORDER BY SORT_NO

mapper.update:
INSERT INTO T_DOC_AO_ANSWER(
	DOC_ID
	, TARGET_ID
	, PERFORM_CNT
	, INQ_NO
	, RND_ID
	, DOC_CLASS_DTL
	, CHOICE_ANSWER
	, SUBJECT_ANSWER
	, SCORE
	, REMARKS
	, CREATE_DATE
	, CREATE_BY
	, UPDATE_DATE
	, UPDATE_BY
)VALUES(
	#{docId, jdbcType=VARCHAR}
	, #{targetId, jdbcType=VARCHAR}
	, #{performCnt, jdbcType=NUMERIC}
	, #{inqNo, jdbcType=NUMERIC}
	, #{rndId, jdbcType=VARCHAR}
	, #{docClassDtl, jdbcType=VARCHAR}
	, #{choiceAnswer, jdbcType=VARCHAR}
	, #{subjectAnswer, jdbcType=VARCHAR}
	, #{score, jdbcType=VARCHAR}
	, #{remarks, jdbcType=VARCHAR}
	, now()
	, #{createBy , jdbcType=VARCHAR}
	, now()
	, #{createBy , jdbcType=VARCHAR}
)
ON DUPLICATE KEY UPDATE
	CHOICE_ANSWER = #{choiceAnswer, jdbcType=VARCHAR}
	, SUBJECT_ANSWER = #{subjectAnswer, jdbcType=VARCHAR}
	, SCORE = #{score, jdbcType=VARCHAR}
	, UPDATE_DATE = now()
	, UPDATE_BY = #{createBy , jdbcType=VARCHAR}

mapper.select:

SELECT PERFORM_CNT
FROM T_PERFORM_TERM
WHERE PERFORM_NM = #{performCnt}

SELECT 
	DOC_NM
FROM
	T_DOC_MST
WHERE
	DOC_ID = #{docId}
	AND DIS_CLASS_DTL = #{disClassDtl}
	AND DOC_CLASS_DTL = #{docClassDtl}

SELECT DISE1.CLASS_CD_DTL_NM DIS_CLASS_DTL, TM.TARGET_ID, TM.TARGET_DIS_ID, TM.RND_ID, CASE TM.SEX WHEN 'F' THEN '여' ELSE '남' END SEX, CONCAT(SUBSTR(VISIT_DATE,1,4) ,'-',SUBSTR(VISIT_DATE,5,2),'-',SUBSTR(VISIT_DATE,7,2)) EXEC_DATE, PT.PERFORM_NM PERFORM_NM, PT.PERFORM_CNT PERFORM_CNT, FN_CAL_AGE(TM.BIRTH_YM,VISIT_DATE) AGE, CASE WHEN ISNULL(PM.EXTS1) OR EXTS1 = 'Z' THEN 'x' WHEN EXTS1 = '#' THEN '-' ELSE 'o' END EXTS1, CASE WHEN ISNULL(PM.CV_CGI_S) OR PM.CV_CGI_S = '' THEN 'x' WHEN PM.CV_CGI_S ='#' THEN '-' ELSE PM.CV_CGI_S END CV_CGI_S, CASE WHEN ISNULL(PM.CV_CGI_I) OR PM.CV_CGI_I = '' THEN 'x' WHEN PM.CV_CGI_I='#' THEN '-' ELSE PM.CV_CGI_I END CV_CGI_I, CASE WHEN ISNULL(PM.CV_C_GAS) OR PM.CV_C_GAS = '' THEN 'x' WHEN PM.CV_C_GAS='#' THEN '-' ELSE PM.CV_C_GAS END CV_C_GAS, CASE WHEN ISNULL(PM.SRS_CLINICAL) OR PM.SRS_CLINICAL = '' OR PM.SRS_CLINICAL = 'Z' THEN 'x' WHEN PM.SRS_CLINICAL='#' THEN '-' ELSE 'o' END SRS01, CASE WHEN ISNULL(PM.CYBOCS) OR PM.CYBOCS = '' OR PM.CYBOCS = 'Z' THEN 'x' WHEN PM.CYBOCS='#' THEN '-' ELSE 'o' END CYBO1, CASE WHEN ISNULL(PM.YBOCS) OR PM.YBOCS = '' OR PM.YBOCS = 'Z' THEN 'x' WHEN PM.YBOCS='#' THEN '-' ELSE 'o' END YBOCS
FROM T_TARGET_MST TM LEFT JOIN T_TARGET_DIS_MST TDM ON TM.TARGET_ID = TDM.TARGET_ORG_ID AND TM.TARGET_DIS_ID = TDM.TARGET_ID
LEFT JOIN T_PERFORM_MST PM ON TM.TARGET_ID = PM.TARGET_ID AND TM.DIS_CLASS_DTL = PM.DIS_CLASS_DTL AND TM.RND_ID = PM.RND_ID
LEFT JOIN T_PERFORM_TERM PT ON TM.RND_ID = PT.RND_ID AND PM.PERFORM_CNT = PT.PERFORM_CNT LEFT JOIN T_CODE_DTL DISE1 ON DISE1.CLASS_CD = 'DISE1' AND DISE1.CLASS_CD_DTL = TM.DIS_CLASS_DTL LEFT JOIN T_CODE_DTL PTC ON PTC.CLASS_CD = 'PT001' AND PTC.CLASS_CD_DTL = TM.PROTOCOL WHERE 1=1 AND TM.RND_ID = '1' AND PM.STATUS != '0004' AND NOT PM.PERFORM_CNT = 2 AND NOT PM.PERFORM_CNT = 3
AND DISE1.CLASS_CD_DTL = #{disClassDtl}
AND TM.TARGET_ID = #{targetId}
AND FN_CAL_AGE(TM.BIRTH_YM,VISIT_DATE) >= #{startAge}
AND FN_CAL_AGE(TM.BIRTH_YM,VISIT_DATE) <= #{endAge}
AND TM.SEX = #{sex}
AND PM.PERFORM_CNT = ${performCnt}
AND EXTS1 IS NOT NULL
AND CV_CGI_S IS NOT NULL
AND CV_CGI_I IS NOT NULL
AND CV_C_GAS IS NOT NULL
AND CYBO1 IS NOT NULL
AND YBOCS IS NOT NULL
AND (TM.TARGET_ID, PM.PERFORM_CNT, TM.RND_ID, TM.DIS_CLASS_DTL) IN (${schKeyWord})
ORDER BY TM.TARGET_ID, PM.PERFORM_CNT LIMIT #{start}, #{limit}

SELECT COUNT(TARGET_ID) FROM ( SELECT TM.TARGET_ID FROM T_TARGET_MST TM LEFT JOIN T_TARGET_DIS_MST TDM ON TM.TARGET_ID = TDM.TARGET_ORG_ID AND TM.TARGET_DIS_ID = TDM.TARGET_ID LEFT JOIN T_PERFORM_MST PM ON TM.TARGET_ID = PM.TARGET_ID AND TM.DIS_CLASS_DTL = PM.DIS_CLASS_DTL AND TM.RND_ID = PM.RND_ID LEFT JOIN T_PERFORM_TERM PT ON TM.RND_ID = PT.RND_ID AND PM.PERFORM_CNT = PT.PERFORM_CNT LEFT JOIN T_CODE_DTL DISE1 ON DISE1.CLASS_CD = 'DISE1' AND DISE1.CLASS_CD_DTL = TM.DIS_CLASS_DTL LEFT JOIN T_CODE_DTL PTC ON PTC.CLASS_CD = 'PT001' AND PTC.CLASS_CD_DTL = TM.PROTOCOL WHERE 1=1
AND PM.STATUS != '0004' AND NOT PM.PERFORM_CNT = 2 AND NOT PM.PERFORM_CNT = 3
AND DISE1.CLASS_CD_DTL = #{disClassDtl}
AND TM.TARGET_ID = #{targetId}
AND FN_CAL_AGE(TM.BIRTH_YM,VISIT_DATE) >= #{startAge}
AND FN_CAL_AGE(TM.BIRTH_YM,VISIT_DATE) <= #{endAge}
AND TM.SEX = #{sex}
AND PM.PERFORM_CNT = ${performCnt}
AND S1 IS NOT NULL
AND CV_CGI_S IS NOT NULL
AND CV_CGI_I IS NOT NULL
AND CV_C_GAS IS NOT NULL
AND CYBO1 IS NOT NULL
AND YBOCS IS NOT NULL
AND (TM.TARGET_ID, PM.PERFORM_CNT, TM.RND_ID, TM.DIS_CLASS_DTL) IN (${schKeyWord})
) T

SELECT COUNT(TARGET_ID) FROM ( SELECT DA.TARGET_ID , FN_CAL_AGE(TM.BIRTH_YM, PM.VISIT_DATE) AGE FROM (SELECT DOC_ID , TARGET_ID , PERFORM_CNT , RND_ID FROM T_DOC_AO_ANSWER WHERE 1=1
AND DOC_ID = #{docId}
GROUP BY DOC_ID, TARGET_ID, PERFORM_CNT, RND_ID) DA JOIN T_TARGET_MST TM ON DA.TARGET_ID = TM.TARGET_ID AND TM.USE_YN = 'Y' LEFT JOIN T_TARGET_DIS_MST TDM ON TM.TARGET_ID = TDM.TARGET_ORG_ID AND TM.TARGET_DIS_ID = TDM.TARGET_ID LEFT JOIN T_CODE_DTL CD ON TM.PROTOCOL = CD.CLASS_CD_DTL JOIN T_PERFORM_TERM PT ON DA.PERFORM_CNT = PT.PERFORM_CNT LEFT JOIN T_PERFORM_MST PM ON DA.TARGET_ID = PM.TARGET_ID AND DA.PERFORM_CNT = PM.PERFORM_CNT AND DA.RND_ID = PM.RND_ID WHERE 1=1 AND PM.STATUS != '0004'
AND TM.DIS_CLASS_DTL = #{disClassDtl}
AND UPPER(DA.TARGET_ID) = UPPER(#{targetId})
AND FN_CAL_AGE(TM.BIRTH_YM, PM.VISIT_DATE) >= #{startAge}
AND FN_CAL_AGE(TM.BIRTH_YM, PM.VISIT_DATE) <= #{endAge}
AND TM.SEX = #{sex}
AND REPLACE(CD.CLASS_CD_DTL_NM," ","") IN (${protocol})
AND DA.PERFORM_CNT = #{performCnt}
AND PT.PERFORM_NM = #{performNm}
) A WHERE 1=1
AND TARGET_ID = #{targetId} AND PERFORM_CNT = ${performCnt} AND DOC_ID = #{docId}

SELECT B.* FROM ( SELECT @ROWNUM := @ROWNUM+1 ROWNUM, A.* FROM ( SELECT DISE1.CLASS_CD_DTL_NM DIS_CLASS_DTL ,DA.TARGET_ID ,TM.TARGET_DIS_ID , CASE WHEN TM.SEX = 'F' THEN '여' WHEN TM.SEX = 'M' THEN '남' END SEX , PM.STATUS , CD.CLASS_CD_DTL_NM PROTOCOL , DA.PERFORM_CNT , PT.PERFORM_NM , DA.DOC_ID , DA.RND_ID
, FN_CAL_AGE(TM.BIRTH_YM, PM.VISIT_DATE) AGE , DA.CHOICE_ANSWER , DA.SUBJECT_ANSWER , DA.SCORE , DA.REMARKS
,IFNULL(CONCAT(SUBSTR(NS.S1_EXEC_DATE,1,4) ,'-',SUBSTR(NS.S1_EXEC_DATE,5,2),'-',SUBSTR(NS.S1_EXEC_DATE,7,2)), CONCAT(SUBSTR(VISIT_DATE,1,4) ,'-',SUBSTR(VISIT_DATE,5,2),'-',SUBSTR(VISIT_DATE,7,2)) ) EXEC_DATE
, IFNULL(CONCAT(SUBSTR(PM.SRS_CLINICAL_DATE,1,4) ,'-',SUBSTR(PM.SRS_CLINICAL_DATE,5,2),'-',SUBSTR(PM.SRS_CLINICAL_DATE,7,2)), CONCAT(SUBSTR(VISIT_DATE,1,4) ,'-',SUBSTR(VISIT_DATE,5,2),'-',SUBSTR(VISIT_DATE,7,2)) ) EXEC_DATE
,IFNULL(CONCAT(SUBSTR(PM.YBOCS_DATE,1,4) ,'-',SUBSTR(PM.YBOCS_DATE,5,2),'-',SUBSTR(PM.YBOCS_DATE,7,2)), CONCAT(SUBSTR(VISIT_DATE,1,4) ,'-',SUBSTR(VISIT_DATE,5,2),'-',SUBSTR(VISIT_DATE,7,2))) EXEC_DATE
,IFNULL(CONCAT(SUBSTR(PM.CYBOCS_DATE,1,4) ,'-',SUBSTR(PM.CYBOCS_DATE,5,2),'-',SUBSTR(PM.CYBOCS_DATE,7,2)), CONCAT(SUBSTR(VISIT_DATE,1,4) ,'-',SUBSTR(VISIT_DATE,5,2),'-',SUBSTR(VISIT_DATE,7,2)) ) EXEC_DATE
FROM (SELECT DOC_ID , TARGET_ID , PERFORM_CNT , RND_ID , GROUP_CONCAT(CHOICE_ANSWER ORDER BY TARGET_ID, PERFORM_CNT, INQ_NO SEPARATOR '|') CHOICE_ANSWER , GROUP_CONCAT(SUBJECT_ANSWER ORDER BY TARGET_ID, PERFORM_CNT, INQ_NO SEPARATOR '|') SUBJECT_ANSWER , GROUP_CONCAT(SCORE ORDER BY TARGET_ID, PERFORM_CNT, INQ_NO SEPARATOR '|') SCORE , GROUP_CONCAT(REMARKS ORDER BY TARGET_ID, PERFORM_CNT, INQ_NO SEPARATOR '|') REMARKS FROM ( SELECT DOC_ID , TARGET_ID , PERFORM_CNT , RND_ID , INQ_NO , CASE WHEN CHOICE_ANSWER IS NULL OR CHOICE_ANSWER = '' THEN 'x' WHEN CHOICE_ANSWER = '#' THEN '-' ELSE CHOICE_ANSWER END CHOICE_ANSWER , CASE WHEN SUBJECT_ANSWER IS NULL OR SUBJECT_ANSWER = ' ' THEN 'x' WHEN SUBJECT_ANSWER = '#' THEN '-' ELSE SUBJECT_ANSWER END SUBJECT_ANSWER , CASE WHEN SCORE IS NULL OR SCORE = '' THEN 'x' WHEN SCORE = '#' THEN '-' ELSE SCORE END SCORE , CASE WHEN REMARKS IS NULL OR REMARKS = '' THEN 'x' WHEN REMARKS = '#' THEN '-' ELSE REMARKS END REMARKS FROM T_DOC_AO_ANSWER WHERE 1=1
AND DOC_ID = #{docId}
AND TARGET_ID = #{targetId}
AND PERFORM_CNT = #{performCnt}
) DA1 GROUP BY DOC_ID, TARGET_ID, PERFORM_CNT, RND_ID) DA JOIN (SELECT @ROWNUM:=0) AS R JOIN T_TARGET_MST TM ON DA.TARGET_ID = TM.TARGET_ID AND TM.USE_YN = 'Y' LEFT JOIN T_TARGET_DIS_MST TDM ON TM.TARGET_ID = TDM.TARGET_ORG_ID AND TM.TARGET_DIS_ID = TDM.TARGET_ID LEFT JOIN T_CODE_DTL CD ON TM.PROTOCOL = CD.CLASS_CD_DTL JOIN T_PERFORM_TERM PT ON DA.PERFORM_CNT = PT.PERFORM_CNT LEFT JOIN T_CODE_DTL DISE1 ON DISE1.CLASS_CD = 'DISE1' AND DISE1.CLASS_CD_DTL = TM.DIS_CLASS_DTL
LEFT JOIN T_PERFORM_MST PM ON DA.TARGET_ID = PM.TARGET_ID AND DA.PERFORM_CNT = PM.PERFORM_CNT AND DA.RND_ID = PM.RND_ID LEFT JOIN T_NEUROPSY_S1 NS ON DA.TARGET_ID = NS.TARGET_ID AND DA.PERFORM_CNT = NS.PERFORM_CNT AND DA.RND_ID = NS.RND_ID WHERE 1=1
AND TM.DIS_CLASS_DTL = #{disClassDtl}
AND UPPER(DA.TARGET_ID) = UPPER(#{targetId})
AND UPPER(TM.TARGET_DIS_ID) = UPPER(#{targetDisId})
AND DA.DOC_ID = #{docId}
AND FN_CAL_AGE(TM.BIRTH_YM, PM.VISIT_DATE) >= #{startAge}
AND FN_CAL_AGE(TM.BIRTH_YM, PM.VISIT_DATE) <= #{endAge}
AND TM.SEX = #{sex}
AND REPLACE(CD.CLASS_CD_DTL_NM," ","") IN (${protocol})
AND DA.PERFORM_CNT = #{performCnt}
AND PT.PERFORM_NM = #{performNm}
ORDER BY DA.TARGET_ID, DA.PERFORM_CNT ) A )B WHERE 1=1 AND B.STATUS != '0004'
AND TARGET_ID = #{targetId} AND PERFORM_CNT = ${performCnt} AND DOC_ID = #{docId}
LIMIT #{start}, #{limit}

mapper.update:

UPDATE T_PERFORM_MST
SET

		EXTS1 = #{execDate}
			WHERE 1=1
			AND PERFORM_CNT = (SELECT PERFORM_CNT FROM T_PERFORM_TERM WHERE PERFORM_NM = UPPER(#{performCntNm, jdbcType=VARCHAR}))
				AND TARGET_ID = #{targetId}
				AND RND_ID = #{rndId}
			AND DIS_CLASS_DTL = #{disClassDtl} 


		SRS_CLINICAL = #{execDate}
		, SRS_CLINICAL_DATE = #{clinicianExecDate}
			WHERE 1=1
		AND TARGET_ID = #{targetId}

		AND PERFORM_CNT = #{performCnt}
		AND RND_ID = #{rndId}
		AND DIS_CLASS_DTL = #{disClassDtl} 


		CYBOCS = #{execDate}
		, CYBOCS_DATE = #{clinicianExecDate}		
			WHERE 1=1
		AND TARGET_ID = #{targetId}

		AND PERFORM_CNT = #{performCnt}
		AND RND_ID = #{rndId}
		AND DIS_CLASS_DTL = #{disClassDtl} 


		YBOCS = #{execDate}
		, YBOCS_DATE = #{clinicianExecDate}		
				WHERE 1=1
		AND TARGET_ID = #{targetId}

		AND PERFORM_CNT = #{performCnt}
		AND RND_ID = #{rndId}
		AND DIS_CLASS_DTL = #{disClassDtl}

UPDATE 
	T_PERFORM_MST 
SET
	CV_CGI_S= #{cvCgiS}
	, CV_CGI_I= #{cvCgiI}
	, CV_C_GAS= #{cvCGas}
	, CLINICAL_VALUATION = #{clinicalValuation}
	, UPDATE_DATE = now()
	, UPDATE_BY = #{updateBy}
WHERE
	TARGET_ID = #{targetId}
	AND DIS_CLASS_DTL = 'DS003'
	AND PERFORM_CNT = #{performCnt}
	AND RND_ID = #{rndId}

